import React from 'react'

const Create = () => {
    return(
        <>
            <div className="cs_main"></div>
            <div className="faq">
                <div className="faq_title">
                    <h3>DEMETER FAQ</h3>
                </div>
                <div className="faq_content">
                    <input type="text" placeholder="Title" value={title}/>
                    <textarea val={content}></textarea>
                </div>
            </div>
        </>
    );
};

export default Create;
